&mdash;her fans all over the world. A multi-talented artist and one of music&rsquo;s most beloved icons, she has racked up global record sales of over 50 million (and 14 Grammy nominations) and has won countless awards, from a Grammy and an Emmy to numerous honors for her tireless activism through her True Colors Fund. Lauper has released 11 studio albums, with her most recent, the Grammy nominated Memphis Blues, ruling the Billboard Blues chart for 14 consecutive weeks to become the best-selling Blues album of 2010. Overall, during her storied music career, Lauper has been nominated for 14 Grammy Awards, 2 American Music Awards, 7 American Video Awards and 18 MTV Awards.	http://www.spraci.com/events/296836	x0aus	adelaide sa australia live all_ages 	2013-06-04	\N	\N	\N	\N	\N	\N	\N	66219	\N	2013-06-12 04:06:08.63115	2013-06-12 04:06:08.63115
