gest the sound of a thousand whips lashing at once; during &quot;The Seer&quot;, they shape feedback into geometric patterns that Sonic Youth and Sunn O))) alike might admireâ€¦<br />In January of 2010, when Gira announced that he was reforming Swans, he wrote a predictably didactic open letter that made his purpose with the band clear: &quot;After five Angels of Light albums, I needed a way to move forward, in a new direction, and it just so happens that revivifying the idea of Swans is allowing me to do that... It's not some dumb-ass nostalgia act. It is not repeating the past.&quot; For the last two years,  one of the world's most bellicose bands has paid respect to its legacy largely by leaving it alone and tried to expand it by testing its old limits. Here, they do just that, beating past successes with the purpose of the present and showing that-- reunion or no, 58-year-old frontman or no-- this is exactly the kind of forward-pointing roadmark Swans deserve.	http://www.spraci.com/events/290860	x0usa	pennsylvania usa pittsburgh 	-0001-11-30	\N	\N	\N	\N	\N	40.429069	-79.982274	0	\N	2013-06-12 04:38:43.313457	2013-06-12 04:38:43.313457
